class FloorPlans {

  String getClassLocationSvg(String location) {
    if (location != 'online') {
      /// "к. КЦ" или "к. 10"
      final building =
      location.substring(3, location.indexOf(',', 3));

      /// "ауд. 403" или "ауд. 403а"
      final classNum = location.substring(
          location.indexOf('ауд. ') + 5, location.length);
      final floor = classNum[0];
      final style = ' style="fill:#0a0" ';

      final initialSvg = new FloorPlans().svgs['b${building}_floor$floor'];
      final pos = initialSvg.indexOf('path10_$classNum');

      return initialSvg.substring(0, pos) +
          'path10_$classNum\"' +
          style +
          initialSvg.substring(
              pos + 'path10_132\"'.length + 1, initialSvg.length);
    }
    return '';
  }

  String getClassLocationSvgBy2Params(String building, String audience) {

      final classNum = audience;
      final floor = classNum[0];
      final style = ' style="fill:#0a0" ';

      final initialSvg = new FloorPlans().svgs['b${building}_floor$floor'];
      final pos = initialSvg.indexOf('path10_$classNum');

      if (pos < 0) return initialSvg;

      return initialSvg.substring(0, pos) +
          'path10_$classNum\"' +
          style +
          initialSvg.substring(
              pos + 'path10_132\"'.length + 1, initialSvg.length);
  }

